This shows that the local variable 'a' is hiding the static variable 'a'. The static variable 'a' is only accessible within the same scope (i.e., within the same function or file) and it retains its value between function calls. The local variable 'a' is only accessible within the same scope and it is re-initialized to 20 every time the function is called.

